import React from 'react';
import {
    Button,
    Cascader,
    DatePicker,
    Form,
    Input,
    InputNumber,
    Mentions,
    Select,
    TreeSelect,
} from 'antd';
import {Text} from "@react-pdf/renderer";
import Title from "antd/es/typography/Title";
import {useParams} from "react-router-dom";
import {observer} from "mobx-react-lite";
import TextArea from "antd/es/input/TextArea";
const { RangePicker } = DatePicker;
const formItemLayout = {
    labelCol: {
        xs: {
            span: 24,
        },
        sm: {
            span: 6,
        },
    },
    wrapperCol: {
        xs: {
            span: 24,
        },
        sm: {
            span: 14,
        },
    },
};
const CreateEvent = () =>{
    const {id} = useParams();
    const titleText = id == undefined ? "Создание мероприятия" : "Редактирование мероприятия";
return(
    <div style={{margin: '2%'}}>
        <Title level={2}>
            {titleText}
        </Title>
    <Form
        {...formItemLayout}
        variant="filled"
        style={{
            maxWidth: 600,
        }}
    >
        <Form.Item
            label="Название"
            name="Name"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Input />
        </Form.Item>

        <Form.Item
            label="Описание"
            name="Discription"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <TextArea
                autoSize={{
                    minRows: 2,
                    maxRows: 6,
                }}
            />
            <div
                style={{
                    margin: '24px 0',
                }}
            />
        </Form.Item>

        <Form.Item
            label="Дата и время"
            name="DateTime"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <DatePicker showTime format="YYYY-MM-DD HH:mm" />
        </Form.Item>

        <Form.Item
            label="Mentions"
            name="Mentions"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Mentions />
        </Form.Item>

        <Form.Item
            label="Select"
            name="Select"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Select />
        </Form.Item>

        <Form.Item
            label="Cascader"
            name="Cascader"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <Cascader />
        </Form.Item>

        <Form.Item
            label="TreeSelect"
            name="TreeSelect"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <TreeSelect />
        </Form.Item>

        <Form.Item
            label="DatePicker"
            name="DatePicker"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <DatePicker />
        </Form.Item>

        <Form.Item
            label="RangePicker"
            name="RangePicker"
            rules={[
                {
                    required: true,
                    message: 'Please input!',
                },
            ]}
        >
            <RangePicker />
        </Form.Item>

        <Form.Item
            wrapperCol={{
                offset: 6,
                span: 16,
            }}
        >
            <Button type="primary" htmlType="submit">
                Submit
            </Button>
        </Form.Item>
    </Form>
    </div>
);
}
export default observer(CreateEvent);
